import React, { useState, useEffect } from 'react';
import { rentAPI } from '../services/api';
import Navbar from '../components/Navbar';
import './Dashboard.css';

const Dashboard = () => {
  const [statistics, setStatistics] = useState({
    totalPending: 0,
    totalPaid: 0,
    overdueCount: 0,
    pendingCount: 0,
    totalEntries: 0
  });
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchStatistics();
  }, []);

  const fetchStatistics = async () => {
    try {
      const response = await rentAPI.getStatistics();
      setStatistics(response.data);
    } catch (error) {
      console.error('Failed to fetch statistics:', error);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <>
        <Navbar />
        <div className="loading-container">
          <div className="spinner"></div>
          <p>Loading...</p>
        </div>
      </>
    );
  }

  return (
    <>
      <Navbar />
      <div className="page-container">
        <div className="page-header">
          <h1>Dashboard</h1>
          <p>Welcome to your Rent Management System</p>
        </div>

        <div className="stats-grid">
          <div className="stat-card pending">
            <div className="stat-icon">üí∞</div>
            <div className="stat-content">
              <h3>Total Pending</h3>
              <p className="stat-value">${statistics.totalPending.toFixed(2)}</p>
              <p className="stat-detail">{statistics.pendingCount} pending payment(s)</p>
            </div>
          </div>

          <div className="stat-card paid">
            <div className="stat-icon">‚úÖ</div>
            <div className="stat-content">
              <h3>Total Paid</h3>
              <p className="stat-value">${statistics.totalPaid.toFixed(2)}</p>
              <p className="stat-detail">All-time collected</p>
            </div>
          </div>

          <div className="stat-card overdue">
            <div className="stat-icon">‚ö†Ô∏è</div>
            <div className="stat-content">
              <h3>Overdue</h3>
              <p className="stat-value">{statistics.overdueCount}</p>
              <p className="stat-detail">Require immediate attention</p>
            </div>
          </div>

          <div className="stat-card total">
            <div className="stat-icon">üìä</div>
            <div className="stat-content">
              <h3>Total Entries</h3>
              <p className="stat-value">{statistics.totalEntries}</p>
              <p className="stat-detail">All rent records</p>
            </div>
          </div>
        </div>

        <div className="quick-actions">
          <h2>Quick Actions</h2>
          <div className="action-buttons">
            <a href="/properties" className="action-btn">
              <span className="action-icon">üè†</span>
              <span>Manage Properties</span>
            </a>
            <a href="/tenants" className="action-btn">
              <span className="action-icon">üë•</span>
              <span>Manage Tenants</span>
            </a>
            <a href="/rent-entries" className="action-btn">
              <span className="action-icon">üìù</span>
              <span>Rent Entries</span>
            </a>
          </div>
        </div>
      </div>
    </>
  );
};

export default Dashboard;
